import React from 'react';

const Leftnav = ({ setBenefits }) => {

    

    const handleClick = () => {
        setBenefits(true)
    }

    return (
        <div>
            <div onClick={handleClick}>
                1
            </div>
            <div>
                2
            </div>
            <div>
                3
            </div>
        </div>
    )
}
export default Leftnav;
